The response pivot report table corresponding to a pivot
request.

Attributes:
    pivot_headers (MutableSequence[google.analytics.data_v1beta.types.PivotHeader]):
        Summarizes the columns and rows created by a pivot. Each
        pivot in the request produces one header in the response. If
        we have a request like this:

        ::

            "pivots": [{
              "fieldNames": ["country",
                "city"]
            },
            {
              "fieldNames": "eventName"
            }]

        We will have the following ``pivotHeaders`` in the response:

        ::

            "pivotHeaders" : [{
              "dimensionHeaders": [{
                "dimensionValues": [
                   { "value": "United Kingdom" },
                   { "value": "London" }
                 ]
              },
              {
                "dimensionValues": [
                { "value": "Japan" },
                { "value": "Osaka" }
                ]
              }]
            },

Report data for each row. For example if RunReportRequest contains:

.. code:: none

   "dimensions": [
     {
       "name": "eventName"
     },
     {
       "name": "countryId"
     }
   ],
   "metrics": [
     {
       "name": "eventCount"
     }
   ]

One row with 'in_app_purchase' as the eventName, 'JP' as the
countryId, and 15 as the eventCount, would be:

.. code:: none

   "dimensionValues": [
     {
       "value": "in_app_purchase"
     },
     {
       "value": "JP"
     }
   ],
   "metricValues": [
     {
       "value": "15"
     }
   ]

Attributes:
    dimension_values (MutableSequence[google.analytics.data_v1beta.types.DimensionValue]):
        List of requested dimension values. In a PivotReport,
        dimension_values are only listed for dimensions included in
        a pivot.
    metric_values (MutableSequence[google.analytics.data_v1beta.types.MetricValue]):
        List of requested visible metric values.
